import { Routes } from '@angular/router';
import { FlightEditComponent } from './issue-edit/issue-edit.component';
import { IssuesListListComponent } from './issue-list/issues-list.component';

export const FLIGHT_ROUTES: Routes = [
  {
    path: 'flights',
    component: FlightListComponent
  },
  {
    path: 'flights/:id',
    component: FlightEditComponent
  }
];
